// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

contract Auction {
    address public highestBidder; // Adresa trenutnog pobednika
    uint256 public highestBid; // Najveća ponuda
    uint256 public auctionEndTime; // Vreme završetka aukcije

    constructor(uint256 biddingTime) {
        auctionEndTime = block.timestamp + biddingTime; // Postavlja vreme završetka aukcije
    }

    function PlaceBid() public payable {
        require(block.timestamp <= auctionEndTime, "Auction has already ended.");
        require(msg.value > highestBid, "There already is a higher bid.");

        if (highestBid > 0) {
            // Vraća novac highest bidder-u
            payable(highestBidder).transfer(highestBid);
        }

        highestBidder = msg.sender;
        highestBid = msg.value;
    }

    function FinalizeAuction() public {
        require(block.timestamp > auctionEndTime, "Auction is still ongoing.");
        // U ovom primeru nagrada ide pobedniku aukcije
        payable(highestBidder).transfer(address(this).balance);
    }

    function GetTimeLeft() public view returns (uint256) {
        if (block.timestamp >= auctionEndTime) {
            return 0;
        }
        return auctionEndTime - block.timestamp;
    }
}

